DROP TABLE IF EXISTS `movies_backdrop`;

CREATE TABLE `movies_backdrop` (
  `file_path` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `movie_id` int(11) NOT NULL,
  `height` int(11) NOT NULL,
  `width` int(11) NOT NULL,
  `iso_639_1` text COLLATE utf8_unicode_ci NOT NULL,
  `vote_average` float NOT NULL,
  PRIMARY KEY (`file_path`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS `movies_cast`;

CREATE TABLE `movies_cast` (
  `credit_id` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `movie_id` int(11) NOT NULL,
  `gender` int(11) NOT NULL,
  `character` text COLLATE utf8_unicode_ci NOT NULL,
  `name` text COLLATE utf8_unicode_ci NOT NULL,
  `order` int(11) NOT NULL,
  `profile_path` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`credit_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS `movies_crew`;

CREATE TABLE `movies_crew` (
  `credit_id` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `movie_id` int(11) NOT NULL,
  `gender` int(11) NOT NULL,
  `job` text COLLATE utf8_unicode_ci NOT NULL,
  `name` text COLLATE utf8_unicode_ci NOT NULL,
  `profile_path` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`credit_id`),
  KEY `movie_id` (`movie_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS `movies_movie`;

CREATE TABLE `movies_movie` (
  `id` int(11) NOT NULL,
  `title` text COLLATE utf8_unicode_ci NOT NULL,
  `title_french` text COLLATE utf8_unicode_ci NOT NULL,
  `genres` text COLLATE utf8_unicode_ci NOT NULL,
  `production_companies` text COLLATE utf8_unicode_ci NOT NULL,
  `imdb_id` text COLLATE utf8_unicode_ci NOT NULL,
  `original_language` text COLLATE utf8_unicode_ci NOT NULL,
  `overview` text COLLATE utf8_unicode_ci NOT NULL,
  `poster_path` text COLLATE utf8_unicode_ci NOT NULL,
  `release_date` int(11) NOT NULL,
  `runtime` int(11) NOT NULL,
  `status` text COLLATE utf8_unicode_ci NOT NULL,
  `tagline` text COLLATE utf8_unicode_ci NOT NULL,
  `vote_average` float NOT NULL,
  `certification` text COLLATE utf8_unicode_ci NOT NULL,
  `certification_french` text COLLATE utf8_unicode_ci NOT NULL,
  `videos` text COLLATE utf8_unicode_ci NOT NULL,
  `seen` tinyint(1) NOT NULL,
  `downloaded` tinyint(1) NOT NULL,
  `subtitle` tinyint(1) NOT NULL,
  `user_id` int(11) NOT NULL,
  `prefered_production_company` int(11) NOT NULL,
  `last_updated` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS `movies_poster`;

CREATE TABLE `movies_poster` (
  `file_path` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `movie_id` int(11) NOT NULL,
  `height` int(11) NOT NULL,
  `width` int(11) NOT NULL,
  `iso_639_1` text COLLATE utf8_unicode_ci NOT NULL,
  `vote_average` float NOT NULL,
  PRIMARY KEY (`file_path`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS `movies_user`;

CREATE TABLE `movies_user` (
  `id` int(11) NOT NULL,
  `name` text COLLATE utf8_unicode_ci NOT NULL,
  `color` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




